INSERT INTO `faq` (`id`, `title`, `description`) VALUES (1,'FAQ','&lt;p&gt;This is demo of FAQ which we have copied from AbhiAndroid website.&lt;/p&gt;\r\n\r\n&lt;h3&gt;How Many Apps Can I Create Using Your Source Code?&lt;/h3&gt;\r\n\r\n&lt;p&gt;Unlimited my friend&amp;hellip; You can use our source code to create your unlimited App but please note you can&amp;rsquo;t use the source code&amp;nbsp;in a project that will be sold, neither you can redistribute or resold source code &amp;ldquo;as-is&amp;rdquo;.&lt;/p&gt;\r\n\r\n&lt;h3&gt;Do you offer any refunds or guarantees?&lt;/h3&gt;\r\n\r\n&lt;p&gt;If our Android App source code doesn&amp;rsquo;t work as described then you can email me within 30 days and our dedicated support team either help you fixing the problem or will give you full refund.&lt;/p&gt;\r\n\r\n&lt;h3&gt;Can I Publish App On Play Store?&lt;/h3&gt;\r\n\r\n&lt;p&gt;Of course! You can customize our source code and use it for uploading your own App on Play Store. The documentation will guide how to easily make changes in code.&lt;/p&gt;\r\n\r\n&lt;h3&gt;Will you be updating the source code?&lt;/h3&gt;\r\n\r\n&lt;p&gt;Absolutely! the source code will be regularly updated with new features and fixing bugs if found in the App. You will always have access to the most up-to-date source code for free.&lt;/p&gt;\r\n\r\n&lt;h3&gt;How long do I have access to source code?&lt;/h3&gt;\r\n\r\n&lt;p&gt;You pay once and you have access to source code for life. This includes all code upgrades and all future App revisions.&lt;/p&gt;\r\n\r\n&lt;h3&gt;I have another question...&lt;/h3&gt;\r\n\r\n&lt;p&gt;Please email to support@abhiandroid.com and I will personally get back to you as quick as I can.&lt;/p&gt;\r\n');
/*!40000 ALTER TABLE `faq` ENABLE KEYS */;
UNLOCK TABLES;

